import Link from "next/link";

export default () => (
  <header>
    <nav>
      <h1>Killerpedia</h1>
      <ul>
        <li>
          <Link>Male killers</Link>
        </li>
        <li>
          <Link>Female killers</Link>
        </li>
        <li>
          <Link>Country</Link>
        </li>
        <li>
          <Link>Serial Killers</Link>
        </li>
        <li>
          <Link>Mass murderers</Link>
        </li>
      </ul>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
          align-items: center;
          text-transform: uppercase;
        }

        ul {
          margin: 0;
          padding: 0;
          display: flex;
          list-style: none;
          justify-content: space-between;
          font-weight: 300;
          font-size: 14px;
        }

        li {
          margin-right: 1rem;
        }

        span {
          margin-right: 1rem;
        }

        h1 {
          font-size: 2rem;
          margin: 4px 0;
          flex: 1;
        }
      `}</style>
    </nav>
  </header>
);
